input = ""

character_index = 0
temp_hash = {}
input.split('').each_with_index do |e, index|
    temp_hash[index + 1] = e

    character_index = temp_hash.keys.last if temp_hash.values.uniq.length == 14

    temp_hash.delete(temp_hash.first.first) if temp_hash.length > 13
    puts character_index if character_index != 0
    return if character_index != 0
end